script: |
  super -f text -I q586.spq | sort > q586.out

inputs:
  - name: q586.spq
    data: |
      SELECT DISTINCT col1 * col2 + col2 * col2 AS col0 FROM tab0 (FORMAT parquet) WHERE col2 NOT BETWEEN + 50 / + 45 + 71 * - 33 AND - col0 * ( - 96 / 11 );
  - name: tab0

outputs:
  - name: q586.out
    data: |
